> Top News Clinton draws early support but also ambivalence from voters FILE - In this Sept. 6, 2015, file photo, a local resident looks through the front door of Uncle Nancy's Coffee House as Democratic presidential candidate Hillary Rodham Clinton speaks during a campaign stop in Newton, Iowa. The Associated Press interviewed nearly 70 Democratic and independent voters in the past two weeks, all at places where Clinton has campaigned in the first-to-vote primary states of Iowa and New Hampshire. Those voters expressed a litany of concerns with Clinton and her candidacy. (AP Photo/Charlie Neibergall, File) 
